		CPackageSysPrintDialog::CPackageSysPrintDialog(IPackage *package) : CPackageComponent(package, L"standard"), m_cIcon{ IconWidth, IconHeight, IconData }
		{
			// Supported platforms

			// Header files
			AddHeaderFile(L"Standard/Components/SysPrintDialog/SysPrintDialog.h");
		}

		IComponent *CPackageSysPrintDialog::Create(IPropertyList **properties, IEventList **events)
		{
			IComponent *result{ new CSysPrintDialog() };
			if (properties)
				*properties = new CSysPrintDialogPropertyList(getPackage(), result, this);
			if (events)
				*events = new CSysPrintDialogEventList(getPackage(), result, this);
			if (properties || events)
				getPackage()->QueryService()->NotifyOnCreateComponent(result, this, *properties, *events);
			return result;
		}

		IPropertyList *CPackageSysPrintDialog::CreatePropertyList(IComponent *component)
		{
			if (isInstance(component))
				return new CSysPrintDialogPropertyList(getPackage(), component, this);
			return nullptr;
		}

		IEventList *CPackageSysPrintDialog::CreateEventList(IComponent *component)
		{
			if (isInstance(component))
				return new CSysPrintDialogEventList(getPackage(), component, this);
			return nullptr;
		}

